import sqlite3 as sql

DB_PATH = 'C:\\bbdd_tfg\\melopongo.db'

def createDB():
    conn = sql.connect(DB_PATH)
    cursor = conn.cursor()
    cursor.execute("DROP TABLE IF EXISTS outfits")
    cursor.execute("""CREATE TABLE outfits (
        id integer,
        percentage text,
        title text,
        imageURL text,
        description text,
        visible integer
        )""")
    cursor.execute("DROP TABLE IF EXISTS profiles")
    cursor.execute("""CREATE TABLE profiles (
        id integer,
        name text,
        username text,
        email text,
        imageURL text,
        visible integer
        )""")
    conn.commit()
    conn.close()
    print('borrar y crear bbdd ok')

